import React from "react";
import {
  ArrowDownOutlined,
  DownOutlined,
  SettingOutlined,
} from "@ant-design/icons";

function Swap() {
  return (
    <div className="tradeBox">
      <div className="tradeBoxHeader">
      <SettingOutlined className="cog" />
        Swap</div>
    </div>
  );
}

export default Swap;
